  <style>html,
body {
  position: relative;
  width: 100%;
  height: 100%;
  background: rgba(230, 126, 34,.1);
}
.credits {
  position: absolute;
  bottom: 20px;
  left: 20px;
  a {
    font-size: 12px;
    transition: all 0.3s ease;
    text-decoration: none;
    color: #202020;
    &:hover {
      color: #3498db;
    }
  }
}
#replay {
  outline: none;
  font-size: 15px;
  position: absolute;
  right: 20px;
  bottom: 20px;
  padding: 5px;
  cursor: pointer;
  transition: all 0.3s ease;
  color: white;
  border: 0;
  background: #3498db;
  &:hover {
    background: lighten(#3498db, 10%);
  }
}
#scene {
  position: absolute;
  bottom: 0;
  left: 50%;
  height: 90%;
  transform: translate3d(-50%,0,0);
}
#ball {
  transform-origin: center 200%;
  transform-origin: center center;
  animation: spin 5s ease-out infinite;
}
.dog {
  transform-origin: center center;
  animation: dog 17s ease infinite;
}
.face-circle {
  transform-origin: center center;
  animation: face 1s ease infinite;
}
.eyebrow-left {
  transform-origin: center center;
  animation: eyebrow-left 1s ease-out infinite;
}
.eyebrow-right {
  transform-origin: center center;
  animation: eyebrow-right 1s ease-out infinite;
}
.bird-left {
  animation: bird-left 12s linear infinite 1s;
  opacity: 0;
}
.bird-right {
  animation: bird-right 15s linear infinite 1s;
  opacity: 0;
}
@keyframes spin {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(-360deg);
  }
}
@keyframes face {
  from {
    transform: scale(.7);
  }
  50% {
    transform: scale(1);
  }
  to {
    transform: scale(.7);
  }
}
@keyframes dog {
  from {
    transform: translate3d(300%, 0 ,0) scaleX(1);
  }
  48% {
    transform: translate3d(-200%, 0 ,0) scaleX(1);
  }
  50% {
    transform: translate3d(-200%, 20% ,0) scaleX(-1);
  }
  52% {
    transform: translate3d(-200%, 0,0) scaleX(-1);
  }
  to {
    transform: translate3d(300%, 0 ,0) scaleX(-1);
  }
}
@keyframes eyebrow-left {
  from {
    transform: translateY(0);
  }
  50% {
    transform: translateY(-5%);
  }
  to {
    transform: translateY(0);
  }
}
@keyframes eyebrow-right {
  from {
    transform: translateY(0);
  }
  50% {
    transform: translateY(-25%);
  }
  to {
    transform: translateY(0);
  }
}
@keyframes bird-right {
  from {
    transform: translateX(500%);
    opacity: 0;
  }
  20% {
    transform: translateX(236%);
    opacity: 1;
  }
  80% {
    transform: translateX(-556%);
    opacity: 1;
  }
  95% {
    transform: translateX(-750%);
    opacity: 0;
  }
  to {
    transform: translateX(-820%);
    opacity: 0;
  }
}
@keyframes bird-left {
  from {
    transform: translateX(-240%);
    opacity: 0;
  }
  20% {
    transform: translateX(-28%);
    opacity: 1;
  }
  80% {
    transform: translateX(608%);
    opacity: 1;
  }
  95% {
    transform: translateX(750%);
    opacity: 0;
  }
  to {
    transform: translateX(820%);
    opacity: 0;
  }
}
</style>

<script>var scene = document.querySelector('#scene');
var mainTimeline = new TimelineMax({onComplete: mainTimelineComplete});
var clapsTimeline = new TimelineMax({paused: true, repeat:-1});
var flashesTimeline = new TimelineMax({paused: true, repeat:-1});

var replayBtn = document.querySelector('#replay');

var groundEls = scene.querySelectorAll('.ground-el');
var groundDotsTop = groundEls[0].querySelectorAll('.ground-dots path');
var groundDotsBottom = groundEls[1].querySelectorAll('.ground-dots path');

var trees = scene.querySelectorAll('#trees g');
var flowers = scene.querySelectorAll('#flowers g');
var house = scene.querySelector('#house').childNodes;

var pool = scene.querySelector('#pool');
var poolAsides = scene.querySelectorAll('.pool-aside');

var characters = scene.querySelectorAll('.character');

var claps = scene.querySelectorAll('.clap');
var flashes = scene.querySelectorAll('.flash');

mainTimeline
  .staggerFrom(groundEls, 1, {opacity: 0, y: '100%', ease: Back.easeOut}, 0.2, 0)
  .staggerFrom(house, 0.3, {opacity: 0, scale: 0.5, ease: Back.easeOut}, 0.03, 0.5)
  .staggerFrom(groundDotsTop, 0.1, {opacity: 0, scale: '0', ease: Elastic.easeOut}, 0.05, 0)
  .staggerFrom(groundDotsBottom, 0.1, {opacity: 0, scale: '0', ease: Elastic.easeOut}, 0.05, 0)
  .staggerFrom(trees, 0.3, {opacity: 0, scale: 0.5, y: 50, ease: Back.easeOut}, 0.05, 0.5)
  .staggerFrom(flowers, 0.2, {opacity: 0, scale: 0.5, y: 50, ease: Back.easeOut}, 0.05, "-=1")
  .from(pool, 0.3, {opacity:0, scale:0, ease: Expo.easeOut}, "-=1")
  .staggerFrom(poolAsides, 0.3, {opacity: 0, scale: 0.5, y: 70, ease: Back.easeOut}, 0.1)
  .staggerFrom(characters, 0.5, {opacity: 0, scale: 0.5, y: 70, ease: Back.easeOut}, 0.1, "-=0.2")
  .from(ball, 1, {opacity: 0, scale: 0, y: 70, ease: Back.easeOut})

clapsTimeline.staggerFrom(claps, 0.2, {opacity: 0, scale: 0, ease: Back.easeOut}, 0.3);
flashesTimeline.staggerFrom(flashes, 1, {opacity: 0, ease: Cubic.easeOut}, 0.1);

replayBtn.addEventListener('click', replay, false);

function mainTimelineComplete() {
  clapsTimeline.play();
  flashesTimeline.play();
}

function replay() {
  mainTimeline.seek(0);
}
</script>